import React from "react";
import { MuiThemeProvider, Grid } from "@material-ui/core";
import Paper from "@material-ui/core/Paper";
import Input from "@material-ui/core/Input";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles({
  item: {
    marginTop: 30,
    marginBottom: 30
  }
});

function LoginAndReg() {
  const classes = useStyles();

  return (
    <MuiThemeProvider>
      <Grid container justify="space-around">
        <h1>Log in or if you new sign up for the YourTime!</h1>
      </Grid>
      <Grid container spacing={2}>
        <Grid item xs={12} sm={6}>
          <Paper>
            <Grid container justify="space-around">
              <h2>Log in</h2>
            </Grid>
            <form>
              <Grid container justify="space-around">
                <Input className={classes.item} required placeholder="Username" type="text" />
                <Input className={classes.item} required placeholder="Password" type="password" />
                <Input className={classes.item} required placeholder="ID" type="text" />
              </Grid>
            </form>
          </Paper>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Paper>
            <Grid container justify="space-around">
              <h2>Sign up</h2>
            </Grid>
            <form>
              <Grid container justify="space-around">
                <Input required placeholder="Username" type="text" />
                <Input required placeholder="Password" type="password" />
                <Input required placeholder="ID" type="text" />
              </Grid>
            </form>
          </Paper>
        </Grid>
      </Grid>
    </MuiThemeProvider>
  );
}

export default LoginAndReg;
